;Openrat.Navigator=new function(){'use strict';this.navigateTo=function(t){Openrat.Workbench.loadNewActionState(t)};this.navigateToNew=function(t){this.navigateTo(t);window.history.pushState(t,t.name,createShortUrl(t.action,t.id))};this.toActualHistory=function(t){window.history.replaceState(t,t.name,createShortUrl(t.action,t.id))};let createShortUrl=function(t,e){return'./#/'+t+(e?'/'+e:'')}};